INSERT INTO "ezcontentobject_attribute" ("attribute_original_id", "contentclassattribute_id", "contentobject_id", "data_float", "data_int", "data_text", "data_type_string", "id", "language_code", "language_id", "sort_key_int", "sort_key_string", "version") VALUES (0,156,1,NULL,NULL,E'<?xml version="1.0" encoding="UTF-8"?>\n<section xmlns="http://docbook.org/ns/docbook" xmlns:xlink="http://www.w3.org/1999/xlink" xmlns:ezxhtml="http://ez.no/xmlns/ezpublish/docbook/xhtml" xmlns:ezcustom="http://ez.no/xmlns/ezpublish/docbook/custom" version="5.0-variant ezpublish-1.0"><title ezxhtml:level="2">Welcome to eZ Platform</title><para>Congratulations, you just installed eZ Platform. eZ Platform is the new generation Content Management Platform from eZ Systems and the eZ Community replacing eZ Publish, our previous software.</para><title ezxhtml:level="3">Need some guidance?</title><para>Check out the following resources:</para><title ezxhtml:level="4"><link xlink:href="ezurl://23" xlink:show="none">User Manual</link> for eZ Platform (and eZ Studio)</title><title ezxhtml:level="4"><link xlink:href="ezurl://24" xlink:show="none">Technical doc</link> for eZ Platform</title><title ezxhtml:level="4"><link xlink:href="ezurl://25" xlink:show="none">eZ Platform</link> developer tutorial</title><title ezxhtml:level="4"><link xlink:href="ezurl://26" xlink:show="none">Comparison guide</link> between eZ Platform and eZ Publish Platform</title><title ezxhtml:level="3">Contribute to the project?</title><para>Join the community:</para><title ezxhtml:level="4"><link xlink:href="ezurl://27" xlink:show="none">Github repositories</link> open to the public</title><title ezxhtml:level="4">Register to the community on <link xlink:href="ezurl://28" xlink:show="none">discuss.ezplatform.com</link>, the community site, to access forums, tutorials and blogs</title><title ezxhtml:level="4">Join the conversation on <link xlink:href="ezurl://29" xlink:show="none">the eZ Community Slack</link></title><para>Good luck!</para></section>\n','ezrichtext',104,'eng-GB',3,0,'',9);
